import Image from "./images/MMfox.png";
import { useMoralis } from "react-moralis";
const Navbar = () => {
    const {authenticate} = useMoralis();
    return ( 
        <div className="navbar">
            <h1>Giving DAO</h1>
            <div className="links">
                <a href="/" className="about">
                    About-Us
                </a>
                <a href="/" className="howItWorks">
                    How-It-Works
                </a>
                <a href="https://github.com/CharDAO" className="document">
                    Documentation
                </a>
            <button className="signin" onClick={() => {authenticate()}}>
                <img src={Image} class="center"/> Connect Metamask
            </button>
            </div>
        </div>
     );
}

export default Navbar;
